    function computeBaseChallenge(Point[] memory cws, Point[] memory cms, Point[] memory cts)
        internal
        pure
        returns (uint256 x, uint256 y)
    {
        uint cwslength = cws.length;
        uint cmslength = cms.length;
        uint ctslength = cts.length;

        uint256 size = 2 * (cwslength + cmslength + ctslength);
        uint256[] memory cs = new uint256[](size);
        uint offset = 0;
        for(uint i=0;i<cwslength;i++) {
            Point memory p = cws[i];
            cs[offset] = p.x;
            offset = offset + 1;
            cs[offset] = p.y;
            offset = offset + 1;
        }
        for(uint i=0;i<cmslength;i++) {
            Point memory p = cms[i];
            cs[offset] = p.x;
            offset = offset + 1;
            cs[offset] = p.y;
            offset = offset + 1;
        }
        uint256 alpha = mod(uint256(keccak256(abi.encodePacked(cs))), NN);
        for(uint i=0;i<ctslength;i++) {
            Point memory p = cts[i];
            cs[offset] = p.x;
            offset = offset + 1;
            cs[offset] = p.y;
            offset = offset + 1;
        }
        uint256 baseChal = mod(uint256(keccak256(abi.encodePacked(cs))), NN);

        return (alpha, baseChal);
    }

    function computeUV(uint256 alpha, uint256[] memory betas, uint256[][] memory us, uint256[][] memory vs,uint256 K, uint256 B)
        internal
        returns (uint256[]memory)
    {

        uint256[] memory Bk = new uint256[](K);
        for(uint i=0; i<K;i++){
           uint256 bPow = pow(B, i);
           Bk[i] = bPow;
        }
        uint256[] memory vprime = new uint256[](K);
        uint256[] memory uvprimes = new uint256[](K);
        uint256 uvprime = 0;
        for(uint i=0;i<K;i++) {
            uint256[] memory alphaBk = mul(Bk, alpha);
            vprime = add(mul(alphaBk, betas), vs[i]);
            uvprime = dot(us[i], vprime);
            uvprimes[i] = uvprime;
        }

        return uvprimes;
    }

